        <div>
            <head>
                <title>당신의 전통주 취향은?</title>
            </head>
            <h2>{props.question}</h2>
            <div>
                {props.answer1}
                {props.answer2}
                {props.answer3}
                {props.answer4}
                {props.answer5}
            </div>
        </div>
    )
}

